import React from 'react';
import './ExpenseFilter.css';

const ExpenseFilter = () => {
    const [dropDownvalue, setDropDownValue] = useState('');
    const dropDownFilterHandler = (event) => {
        setDropDownValue(event.target.value);
    }

    return (<div className='expenses-filter'>
        <div className='expenses-filter__control'>
            <label className='expenses-filter__label'>Filter By Year</label>
            <select className='expenses-filter__select' value={props.selected} onChange={dropDownFilterHandler}>
                <option value='2020'>2020</option>
                <option value='2021'>2021</option>
                <option value='2022'>2022</option>
                <option value='2019'>2020</option>
            </select>
        </div>
    </div>);
}

export default ExpenseFilter;
